import './App.css';
import React, { useState, useEffect } from 'react';

import axios from 'axios';


function App() {
  const [activeIndex, setActiveIndex] = useState(0);

  // Use the useEffect hook to apply the CSS classes based on the condition
  useEffect(() => {
    if (activeIndex===0) {
      document.body.className = 'panel-landing';
    } else {
      document.body.className = 'panel-ud';
    }

    // Cleanup function to remove the classes when the component is unmounted
    return () => {
      document.body.className = '';
    };
  }, [activeIndex]);




  return (
    <>
      <Panel isActive={activeIndex === 0}>
        <div>
          <Landing onAction={() => setActiveIndex(1)} />
        </div>  
      </Panel>

      <Panel isActive={activeIndex === 1}>
        <div className="panel1">
          <UploadDownload />
        </div>
      </Panel>
    </>
  );
}



function Panel({ children, isActive}) {
  return (
    <section className="panel">
      {isActive ? <p>{children}</p> : null}
    </section>
  );
}



export function Landing({ onAction }) { 

  const [AuthPin, setAuthPin] = useState('')

  const handleAuth = (v) => {
      if (v.length <= 5) {
          setAuthPin(v)
      }
  }

  const [, setUpload] = useState(false)
  const [, setCodesubmit] = useState(false)

  function generateCode() {
    setUpload(true)
    onAction();
  }

  function handleSubmitCode(){
    setCodesubmit(true)
    onAction();
  }

return (
  <div class="center">
    <h1 className="font-link">Firefly</h1>
          <br></br>
          <div className="button-23">
          <div className="button-24">
            {
                <button onClick={generateCode}>
                  Generate Code
                </button>
            }
          </div>

            <br></br>
            <br></br>
            <p>input pin:</p>
            <input
                value={AuthPin}
                onChange={(e) => handleAuth(e.target.value)}
                className="space"
                type="number"
                id="pin"
                pattern="\d*"
                inputMode="numeric"
            />
            <br></br>
            <br></br>
            <button
              onClick={handleSubmitCode}
              className={`button-25${AuthPin.length !== 5 ? " disabled" : ""}`}
              disabled={AuthPin.length !== 5}
            >
              Submit
            </button>
          </div>
  </div>
);
}


export function UploadDownload() { 
  const [file, setFile] = useState();
  const [uploadedFiles, setUploadedFiles] = useState([]);

  useEffect(() => {
    // Fetch the list of files from the server
    // Replace this with the real API call
    const fetchFiles = async () => {
      const response = await axios.get('http://localhost:3000/getFiles');
      setUploadedFiles(response.data.files);
    };
    fetchFiles();
  }, []);

  //...

  function handleDownloadAll() {
    // Add your logic to download all files here
  }

  return (
    <div className="sidebar">
      {/* ... */}
      <div className="file-list-wrapper">
        <h2>Uploaded Files:</h2>
        <ul className="file-list">
          {uploadedFiles.map((file, index) => (
            <li key={index}>{file}</li>
          ))}
        </ul>
      </div>
      <button
        type="button"
        onClick={handleDownloadAll}
        className="download-all-btn"
      >
        Download All
      </button>
    </div>
  );
}




export default App;
